import React from 'react'
import CardUI from '../Card/CardUI'

const CardsUI = ({data, city}) => {
    const cards = data.map(el => <CardUI temp={el.temp} />)
    return (
        <div>
            <div>{city}</div>
            {cards}
        </div>
    )
}

export default CardsUI
